function App() {
  return (
    <BrowserRouter>
      <NavLink to="/menu">
        <button>Menu test</button>
      </NavLink>
      <NavLink to="/drinks">
        <button>Drink test</button>
      </NavLink>
      <br />
      <Switch>
        <Route path="/drinks" exact component={DrinkCards} />
